}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`RedisInsight, a free web-based GUI management interface for Redis, offers several tools to manage and optimize Redis, with the main focus on memory optimization. RedisInsight Memory analysis helps you analyze your Redis instance, reduce memory usage, and improve application performance.`}</p>
    <p>{`Let’s assume that you noticed high memory usage out of your Redis instance and you want to analyze any specific cache/key pattern, which may be consuming most of the memory or not using Redis in a very efficient way. RedisInsight is a great tool that can help you analyze memory used by Redis through  keys or key patterns, expiry,data types, or the instance’s internal encoding. Analysis can be done in two ways—online and offline mode(discussed later in the tutorial).`}</p>
    <p>{`This tutorial demonstrates the below list of features under RedisInsight:`}</p>
    <ul>
      <li parentName="ul">{`Memory Overview`}</li>
      <li parentName="ul">{`Keyspace Summary`}</li>
      <li parentName="ul">{`Recommendations`}</li>
      <li parentName="ul">{`Memory Analyzer`}</li>
    </ul>
    <p>{`Follow the steps below to see how memory analysis can be performed over Redis Database(RDB) dumps using RedisInsight.`}</p>
    <h2 {...{
      "id": "step-1-create-a-redis-database"
    }}>{`Step 1: Create a Redis database`}</h2>
    <p><a parentName="p" {...{
        "href": "https://developer.redislabs.com/create"
      }}>{`Follow this link `}</a>{`to create Redis database`}</p>
    <h2 {...{
      "id": "step-2-download-redisinsight"
    }}>{`Step 2: Download RedisInsight`}</h2>
    <p>{`To install RedisInsight on your local system, you need to first download the software from Redis Labs website.`}</p>
    <p><a parentName="p" {...{
        "href": "https://redislabs.com/redis-enterprise/redis-insight/#insight-form"
      }}>{`Click this link `}</a>{` to access a form that allows you to select the operating system of your choice.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsightinstall.png").default} /></p>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`If you're using RedisInsight Docker container, you might need to follow the below steps to add a mount point so as to acess the RDB dumps.`}</p></div></div>
    <p>{`It is recommended to add a volume mount point using the ”-v” parameter as shown below:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` mkdir memorytest
 docker run -d -v /temp/memorytest:/db -p 8001:8001 redislabs/redisinsight:latest
`}</code></pre>
    <p>{`Run the installer. After the web server starts, open http://YOUR_HOST_IP:8001 and add a Redis database connection.`}</p>
    <p>{`Select "Connect to a Redis database"`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/redisinsight4.png").default} /></p>
    <h2 {...{
      "id": "step-3-connect-to-redis-database"
    }}>{`Step 3: Connect to Redis database`}</h2>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image2.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "step-4-store-redis-user-sample-datasets"
    }}>{`Step 4: Store Redis user sample datasets`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` git clone https://github.com/redis-developer/redis-datasets
 cd redis-datasets/user-database
`}</code></pre>
    <p>{`Execute the below command to import users database`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-cli -h 192.168.1.9 -p 6379 < ./import_users.redis
 ..
 ..
 "5996 Users Created"
`}</code></pre>
    <p>{`Under RedisInsight GUI, click on “Memory Analyzer” under Browser.
Before you click on “Analysis,” ensure that you store dump.rdb at the right location.
If you’re on Mac, the Redis dump file is located under /usr/local/var/db/redis`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` tree /usr/local/var/db 
 /usr/local/var/db
 └── redis
   └── dump.rdb

 1 directory, 1 file

`}</code></pre>
    <p>{`Copy the dump.rdb to /memorytest/ location. You can also verify if that file is available in the container by using docker exec command.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` ls
 bulk_operation     dump.rdb        queries.log     redisinsight.log
 dropbox            profiler_logs       redisinsight.db     rsnaps
`}</code></pre>
    <p>{`Memory analysis in RedisInsight is done in two different ways:`}</p>
    <ul>
      <li parentName="ul"><strong parentName="li">{`Online mode`}</strong>{` - In this mode, RedisInsight downloads a rdb file from your connected redis instance and analyzes it to create a temp file with all the keys and meta data required for analysis. `}</li>
      <li parentName="ul"><strong parentName="li">{`Offline mode`}</strong>{` - In this mode, RedisInsight analyzes your Redis backup files. These files can either be present in your system or on s3. RedisInsight accepts a list of rdb files given to it and analyzes all the information required from these files instead of downloading it from your Redis instance. `}</li>
    </ul>
    <p>{`Choose the offline analysis approach if you have a RDB Backup file that you want to analyze. `}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image4.png").default} title="image_tooltip" /></p>
    <p>{`Enter the right location of the RDB backup file as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image5.png").default} title="image_tooltip" /></p>
    <p>{`Click “Proceed”.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image6.png").default} title="image_tooltip" /></p>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`If you are using online memory analysis, you will want to have enough space to store the RDB file for your Redis database. This is usually 10-50% of the Redis instance’s memory usage.`}</p></div></div>
    <h2 {...{
      "id": "keyspace-summary"
    }}>{`Keyspace Summary`}</h2>
    <p>{`Keyspace Summary identifies the top key patterns from the set of keys in descending order of memory. This helps you identify which key patterns are consuming most of your memory and what are the top keys for that pattern. You can add your own key patterns in order to identify their memory usage and the top keys for that key pattern.`}</p>
    <p>{`Click “Keyspace” and you will see the total memory consumed by each of the top key patterns as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image7.png").default} title="image_tooltip" /></p>
    <p>{`You can click on each of these keys patterns(as shown above) and check the memory usage.`}</p>
    <h2 {...{
      "id": "recommendations"
    }}>{`Recommendations`}</h2>
    <p>{`RedisInsight provides recommendations on how you can save your memory. The recommendations are specially curated according to your Redis instance. These recommendations have been formed based on industry standards.`}</p>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Combine Small Strings to Hash`}</p><p parentName="div">{`Small key value pairs in redis consume a lot of memory because a top level key has several overheads. If you do not need an expiry on these keys, you can combine multiple keys into a larger hash. As long as the hash has less than 512 elements and the size of each element is within 64 bytes, you will save a significant amount of memory.
Read Instagram's blog post on how they used this technique to save memory
Once you combine strings into a larger hash, evaluate hash-max-ziplist-entries and hash-max-ziplist-value settings. You may want to increase them to save even more memory.`}</p><p parentName="div">{`Performance comes with a cost. By converting the strings to hash, we will be saving on a lot of memory because it saves only the string value and no extra information like: idle time, expiration, object reference count, and encoding related to it. But if we want the key with the expiration value, we can't associate it with a hash structure as expiration is not available. Read More`}</p></div></div>
    <p>{`Let us add 1 million keys using redis-benchmark tool:`}</p>
    <p>{`Fill 127.0.0.1:6379 with about 1 million keys only using the SET test:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` redis-benchmark -t set -n 1000000 -r 100000000
 …
 100.000% <= 1011.199 milliseconds (cumulative count 1000000)

Summary:
 throughput summary: 13451.89 requests per second
 latency summary (msec):
         avg       min       p50       p95       p99       max
       3.600     0.616     3.007     5.591     7.567  1011.199

`}</code></pre>
    <p>{`Click on Recommendations and you will see the below messages`}</p>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`important`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`Avoid unnecessary Long Keys `}</p><p parentName="div">{`You can save some memory by avoiding large keys. In general, you should always prefer descriptive keys. This recommendation only applies if you have millions of very large keys. In a well written application, switching to shorter keys usually involves updating a few constant strings in the application code.
The trade off of converting large keys to smaller keys is that large Keys were more descriptive then shortened keys, hence when reading through your database you may find the keys less relatable. Read More
Key patterns that need to be modified:
key:*`}</p></div></div>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image11.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "memory-analyzer"
    }}>{`Memory Analyzer`}</h2>
    <p>{`Memory Analyzer lets you search a key or key patterns and get related information regarding it with other stats. You can apply various filters and aggregations using our advance filters feature.`}</p>
    <p>{`When the `}<inlineCode parentName="p">{`analyze-memory`}</inlineCode>{` button is clicked, it connects to the redis instance and takes a point-in-time snapshot of the database. `}<a parentName="p" {...{
        "href": "https://docs.redislabs.com/latest/ri/using-redisinsight/memory-analysis/#how-memory-analysis-works"
      }}>{`Here’s a link`}</a>{` that deep dive into SYNC and DUMP approach`}</p>
    <p>{`Considering 1 million keys only using the SET command, you can view the memory analyzer section and click “Advanced Filters”.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image13.png").default} title="image_tooltip" /></p>
    <p>{`The advanced filters allow you to choose data type, encoding, memory, group by data types, encoding, aggregate etc.`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image14.png").default} title="image_tooltip" /></p>
    <p>{`You can check memory usage by key:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image15.png").default} title="image_tooltip" /></p>
    <h2 {...{
      "id": "additional-links"
    }}>{`Additional Links`}</h2>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/slowlog"
        }}>{`Slowlog Configuration using RedisInsight`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/browser"
        }}>{`Explore Redis keys using RedisInsight browser tool`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/explore/redisinsight/cluster"
        }}>{`Cluster Management with ease using RedisInsight`}</a></li>
    </ul>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
